import React from 'react';

const Signin = ()=>{
    return(
        <div>
            <div class="card">
               <h2>HOUX</h2>
               <input text="text" placeholder="email"/>
               <input text="text" placeholder="password"/>
               <a class="waves-effect waves-light btn"><i class="material-icons left">cloud</i>button</a>
            </div>
        </div>
    )
}

export default Signin
